                    label="development"
                    path="/works/01"
                    />
                    <Carditem
                    align="cards__item rightalign"
                    src="images/dk_w_rld_logo2.jpg"
                    num="02"
                    title="breathe"
                    // desc="this works blbl lorem ipsum"
                    label="branding"
                    path="/works/02"
                    />
                </ul>
                <Link to="/works"><p>더 많은 작업물보기</p></Link>
            </div>
        </div>
    )
}

export default Cards
